import React, { useContext } from "react";
import ExitToAppIcon from "@material-ui/icons/ExitToApp";
import "../styles.css";
import { Link } from "react-router-dom";
import { Navbar, Nav } from "react-bootstrap";

export default function Navbar1(props) {
  const authContext = useContext(AuthContext);

  if (!authContext) return null; // حماية لو ما فيه Provider

  const { isAuthenticated } = authContext;

const { logout } = useContext(AuthContext);
  const [showToast, setShowToast] = useState(false);

  const handleLogout = () => {
    logout(); // مسح التوكن وتفريغ المستخدم
    setShowToast(true);

    setTimeout(() => {
      setShowToast(false);
      window.location.href = "/"; // يرجع للصفحة الرئيسية
    }, 2000);
  };

  return (
    <Navbar
      style={{
        position: "sticky",
        top: "0",
        zIndex: "100000",
        display: "flex",
        justifyContent: "space-between",
        fontFamily: "Mulish",
      }}
      bg="primary"
      variant="dark"
    >
      <Navbar.Brand className="navbar titl">
        <Link to="/" style={{ color: "white", fontFamily: "Mulish" }}>
          Food Eazy <i className="fas fa-utensils" />
        </Link>
      </Navbar.Brand>

      <Nav>
        <div className="navLogout">
          <Link to="/" style={{ color: "white", textDecoration: "none" }}>
            <span className="bg_grey">Home</span>
          </Link>
        </div>

        {isAuthenticated && (
          <>
            <div className="navLogout">
              <Link
                to="/order"
                style={{ color: "white", textDecoration: "none" }}
              >
                <span className="bg_grey">Orders</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link
                to="/addproduct"
                style={{ color: "white", textDecoration: "none" }}
              >
                <span className="bg_grey">Add Items</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link
                to="/deleteitems"
                style={{ color: "white", textDecoration: "none" }}
              >
                <span className="bg_grey">Delete Items</span>
              </Link>
            </div>

            <div className="navLogout">
              <Link
                to="/contact"
                style={{ color: "white", textDecoration: "none" }}
              >
                <span className="bg_grey">Contact Us</span>
              </Link>
            </div>
<div className="navLogout">
        <button
          type="button"
          onClick={handleLogout}
          style={{
            border: "none",
            outline: "none",
            color: "white",
            background: "transparent",
            cursor: "pointer",
            display: "flex",
            alignItems: "center",
            gap: "5px"
          }}
        >
          Logout <ExitToAppIcon />
        </button>
      </div>

      {showToast && (
        <Toast
          style={{
            position: "fixed",
            top: "20px",
            left: "50%",
            transform: "translateX(-50%)",
            backgroundColor: "#28a745",
            color: "white",
            fontWeight: "bold",
            borderRadius: "10px",
            padding: "10px 20px",
            zIndex: 9999
          }}
        >
          <Toast.Body>✅ تم تسجيل الخروج بنجاح</Toast.Body>
        </Toast>)}
          </>
        )}

        <span className="hamburger">
          <i
            onClick={props.changeDisplay}
            className="fa fa-bars"
            aria-hidden="true"
          />
        </span>
      </Nav>
    </Navbar>
  );
}
